	const block0 = (context) => { return html`<div tabindex="${ifDefined(context._tabIndex)}" @click="${context._handleSelect}" @keydown="${context._keydown}" class="ui5-token--wrapper" dir="${ifDefined(context.effectiveDir)}" role="option" aria-selected="${ifDefined(context.selected)}"><span class="ui5-token--text">${ifDefined(context.text)}</span>${ !context.readonly ? block1(context) : undefined }</div>`; };
const block1 = (context) => { return html`<div class="ui5-token--icon" @click="${context._delete}">${ context.closeIcon.length ? block2(context) : block3(context) }</div>`; };
const block2 = (context) => { return html`<slot name="closeIcon"></slot>`; };
const block3 = (context) => { return html`<${scopeTag("ui5-icon", tags, suffix)} name="${ifDefined(context.iconURI)}" accessible-name="${ifDefined(context.tokenDeletableText)}" show-tooltip></${scopeTag("ui5-icon", tags, suffix)}>`; };


	return block0(context);
};

export default main;
